sys_variable_value.value:
(function execute(inputs, outputs) {

    var Response = false;

    var atualizarAvailableSeats = new Flow_event_registration();
    Response = atualizarAvailableSeats.atualizarAvailableSeats(inputs.parameter_availableseats);

    outputs.parameter_availableseats = Response;

})(inputs, outputs);

